"""## Step1: å¾žè¿·å› åœ–ç‰‡æå–æ–‡å­—å°è©±æè¿°

"""

if 'img' in locals():
    # This prompt asks for a structured JSON output for easier processing.
    prompt = """
    You are an expert meme analyst. Your task is to analyze the provided image.
    1.  First, determine if the image contains clear, readable text (e.g., captions, dialogue).
    2.  If it DOES contain text: Extract the text verbatim.
    3.  If it does NOT contain text (or the text is unreadable): Create a short, funny, meme-style dialogue that fits the scene, characters, and mood.
    4.  Identify the primary language of the extracted or generated text. Use standard language codes (e.g., 'en' for English, 'zh-tw' for Traditional Chinese, 'ja' for Japanese, 'es' for Spanish).
    5.  Return your response as a single JSON object with two keys: "language_code" and "text". Do not add any other explanatory text or formatting.

    Example for an English meme:
    {
        "language_code": "en",
        "text": "This is the text from the meme."
    }

    Example for a Japanese meme without text:
    {
        "language_code": "ja",
        "text": "é¢ç™½ã„ã‚»ãƒªãƒ•ã‚’ç”Ÿæˆã—ã¾ã—ãŸã€‚"
    }
    """

    print("Asking Gemini to analyze the image and detect language...")

    try:
        # Send the prompt and the image to the model
        response = client.models.generate_content(
            model=model,
            config=types.GenerateContentConfig(
                system_instruction=system_instruction,
                thinking_config=types.ThinkingConfig(thinking_budget=thinking_budget)
            ),
            contents=[
                types.Part.from_bytes(
                    data=img_data,
                    mime_type='image/jpeg',
                ),
                prompt
            ]
        )

        # Clean up the response to ensure it's valid JSON
        cleaned_response = response.text.strip().replace("```json", "").replace("```", "")

        # Parse the JSON string into a Python dictionary
        result = json.loads(cleaned_response)
        meme_text = result.get("text", "Error: Could not parse text.")
        lang_code = result.get("language_code", "en") # Default to English if not found

        print(f"\nðŸ¤– Gemini's Analysis:")
        print(f"   Language: {lang_code}")
        print(f"   Text: {meme_text}")

    except (json.JSONDecodeError, AttributeError, Exception) as e:
        print(f"An error occurred while processing the model's response: {e}")
        meme_text = "Sorry, I couldn't process that meme."
        lang_code = "en" # Fallback to English on error

else:
    print("Please run the previous cell to upload an image first.")
    meme_text = ""
    lang_code = ""

"""## Step2: ç”¢ç”Ÿé…éŸ³(ç”¨Google cloud TTS API)"""

# In the fifth cell, generate and play the audio.
from gtts import gTTS
from IPython.display import Audio, display

if meme_text and lang_code:
    print(f"\nGenerating audio in '{lang_code}'...")

    try:
        # Use the detected language code in the gTTS function
        tts = gTTS(text=meme_text, lang=lang_code)

        # Save the audio to an mp3 file
        audio_file = "meme_audio.mp3"
        tts.save(audio_file)

        print(f"Audio file saved: {audio_file}")

        # Play the audio file directly in the notebook
        print("â–¶ï¸ Playing audio:")
        display(Audio(audio_file, autoplay=True))

    except ValueError as e:
        print(f"Error generating audio: {e}")
        print(f"It's possible the language code '{lang_code}' is not supported by gTTS. Please check gTTS documentation for supported languages.")
    except Exception as e:
        print(f"An unexpected error occurred during audio generation: {e}")

else:
    print("No text available to generate audio.")

