import ChatTTS
import torch
import torchaudio # Explicitly import torchaudio as it's used for saving
from IPython.display import Audio, display

if meme_text:
    print(f"\nGenerating audio with ChatTTS for: {meme_text}")

    try:
        # Load the ChatTTS model
        chat = ChatTTS.Chat()
        chat.load()

        # Generate speech. You might want to adjust the `spk` and `temperature` parameters.
        # spk can be a tensor or a list of tensors for different speakers.
        # For simplicity, we'll use a single random speaker here.
        # The language code 'zh-tw' is handled by ChatTTS's underlying tokenizer.

        # If the language is Chinese, pass as a list of text string
        if lang_code.startswith('zh'):
            texts = [meme_text]
        else:
            texts = [meme_text] # ChatTTS handles various languages, but Chinese often has better results

        # Sample speaker. For more control, you can generate and save specific speaker embeddings.
        rand_spk = chat.sample_random_speaker()

        # Generate speech
        # Generate speech
        wavs = chat.infer(texts)


        # Save the audio to a file
        chattts_audio_file = "chattts_meme_audio.mp3"
        # ChatTTS returns a list of numpy arrays if multiple texts are passed.
        # For a single text, we take the first element.
        audio_tensor = torch.from_numpy(wavs[0])
        torchaudio.save(chattts_audio_file, audio_tensor.unsqueeze(0), 24000) # Assuming 24000 Hz sample rate

        print(f"Audio file saved: {chattts_audio_file}")

        # Play the audio file
        print("â–¶ï¸ Playing ChatTTS audio:")
        display(Audio(chattts_audio_file, autoplay=True))

    except Exception as e:
        print(f"An error occurred during ChatTTS audio generation: {e}")
else:
    print("No text available to generate audio with ChatTTS.")